    "bug_report_description": "After the match ends with Butch tapping out to Santos Escobar's submission, Butch's character model attempts to recover from the prone position. During the transition animation (around 0:24-0:26), Butch's torso and limbs violently twist and contort unnaturally, resembling a ragdoll physics error, before snapping into the intended crawling animation. This breaks immersion and indicates a potential bug in the physics or animation blending for post-match recovery states.",
    "affected_item": "Character Model / Physics / Animation"
}

{
    "reasoning": "The video shows a character model standing on the exterior fuselage of a helicopter while it is in flight. This is physically unrealistic and not an intended interaction with the vehicle, indicating a potential collision or physics bug.",
    "bug_report_title": "Character Standing on Top of Flying Helicopter Fuselage",
    "bug_report_description": "During flight, a character model is positioned standing directly on the top surface of the helicopter's main body, near the rotor mast, rather than inside the cabin or on designated skids. The character remains relatively stable despite the helicopter's movement. This suggests an issue with the vehicle's collision mesh or player physics interaction, allowing characters to occupy unintended and physically impossible positions on the vehicle.",
