    "bug_report_description": "During gameplay, an AI-controlled white Fiat 500 was observed driving backwards at a significant speed along the road. The car remained in its lane but traveled in reverse, approaching the player's vehicle head-on (or rather, rear-on). This is likely an AI pathfinding or physics bug.",
    "affected_item": "AI Vehicle"
