    "bug_report_description": "A flying bird (appears to be a hawk or eagle) has multiple arrows visibly embedded in its model. These arrows remain fixed to the bird as it continues its flight path, ignoring gravity and the expected physical reaction to being hit. The bird does not fall from the sky or appear hindered by the arrows. This indicates a potential bug in projectile collision, physics simulation for the bird NPC, or the damage state calculation.",
