    "bug_report_description": "When activating a biotic power around the 0:01-0:02 mark, the player character's 3D model momentarily renders as a solid black silhouette. This occurs just as the purple/blue energy visual effect begins to manifest and lasts for only a fraction of a second before the model renders correctly within the effect. This is likely a shader or rendering order issue.",
    "affected_item": "Player Character Model / Visual Effects"
}

{
